import choicesService from "../services/choices.service";

export const submitChoices = (choice) => dispatch => {

    return choicesService
        .submitSelectedChoices()
        .then(response => {
            return Promise.resolve(response);
        })
        .catch(err => {
            return Promise.resolve(err);
        })
}
